import React, { Component } from 'react';
import '../styles/navbar.scss';
import { slide as Menu } from "react-burger-menu";
import Header from './Header';
import About from './About';
import Work from './Work';
import Contact from './Contact';
import {
    BrowserRouter as Router,
    Route,
    Link
  } from "react-router-dom";

class Navbar extends React.Component {
    constructor (props) {
        super(props)
        this.state = {
            menuOpen: false
        }
    }

    handleStateChange (state) {
        this.setState({menuOpen: state.isOpen})
    }

    closeMenu () {
        this.setState({menuOpen: false})
    }

    toggleMenu () {
        this.setState(state => ({menuOpen: !state.menuOpen}))
    } 

    render () {
        return(
            <Router>
            <Menu isOpen={this.state.menuOpen} onStateChange={(state) => this.handleStateChange(state)} right width={ '100vw' } >
                <Link to="/" onClick={() => this.closeMenu()}>Home</Link>
                <Link to="/about" onClick={() => this.closeMenu()}>About</Link>
                <Link to="/work" onClick={() => this.closeMenu()}>Work</Link>
                <Link to="/contact" onClick={() => this.closeMenu()}>Contact</Link>
            </Menu>

            <Route exact path="/about" component={About} />
            <Route exact path="/work" component={Work} />
            <Route path="/contact" component={Contact} />
            <Route path="/" component={Header} />
        </Router>
        )
    }

}

export default Navbar;
